import React from "react";
import { Link } from "react-router-dom";
const Navbar = () => {
  return (
    <>
      <Link>
        <a href="/">About Us</a>
        <a href="/contact">Contact Us</a>
      </Link>
    </>
  );
};

export default Navbar;
